    return (
        <div>

              <a href="#Bio"
               onClick={() => handlePageChange('Bio')}
                className=
                {currentPage === 'Bio' ? 'nav-active' : 'nav ' }  >
                    Bio</a>

              <a href="#Portfolio"
              onClick={() => handlePageChange('Portfolio')} 
              className=
              {currentPage === 'Portfolio' ? 'nav-active' : 'nav'}>
                  Portfolio</a>

